    public static class Tanks
    {
        public static Tank FindByTag(Version version, string tag)
        {
            if (tag == null)
                return null;

            VersionList source;
            switch(version)
            {
                case Version.Version9_19_1:
                    source = Version9_19_1List.Instance;
                    break;
                case Version.Version9_19_or_lower:
                    source = Version9_18List.Instance;
                    break;
                case Version.Version9_17_or_lower:
                    source = Version9_17List.Instance;
                    break;
                default:
                    throw new ArgumentException();
            }

            Tank t;
            if(source.ByTag.TryGetValue(tag?.ToLower(), out t))
            {
                return t;
            }
            return null;
        }

        public enum Version { Version9_19_1, Version9_19_or_lower, Version9_17_or_lower };

        public class VersionList
        {
            public List<Tank> List { get; protected set; }

            private Dictionary<string, Tank> byTag;
            public Dictionary<string, Tank> ByTag
            {
                get
                {
                    if (this.byTag == null)
                    {
                        this.byTag = List.ToDictionary(t => t.Tag, t => t);
                    }

                    return this.byTag;
                }
            }
        }

